import React from 'react'
import ARR from './images'
import './takeimageinput.css'

export default function Takeimageinput() {
  return (
    <div id='images'>
        <div>
            <div>
      {ARR.map((e)=>{
          return <button><img src={e} height="70px" /></button>
        })}
        </div>
        <button>X</button>
        
        </div>
    </div>
  )
}
